import './Asked.css';

import { Col, Container, Row } from "react-bootstrap"

function Asked(){

    const ArraysOfAsked = [{
        id: 1,
        header: "",
        body: ""
    },
    {
        id: 2,
        header: "",
        body: ""
    },
    {
        id: 3,
        header: "",
        body: ""
    },
    {
        id: 4,
        header: "",
        body: ""
    }]
    const ArraysOfAskedOnMap = ArraysOfAsked.map((ArrayOfAsked) =>
    <Accordion key = {ArrayOfAsked.id}>
        <Accordion.Item>
            <Accordion.Header>{ArrayOfAsked.header}</Accordion.Header>
            <Accordion.Body>{ArrayOfAsked.body}</Accordion.Body>
        </Accordion.Item>
      </Accordion>
    )

    return(
        <Container className = "asked">
            <Row>
                <Col md = "4">
                    <h1>Frequently Asked Questions</h1>
                    <p>Risus commodo id odio turpis pharetra elementum. Pulvinar porta porta feugiat scelerisque in elit. Morbi rhoncus, tellus, eros consequat magna semper orci a tincidunt. </p>
                </Col>
                <Col md = "4">{ArraysOfAskedOnMap}</Col>
                <Col md = "4">{ArraysOfAskedOnMap}</Col>
            </Row>
        </Container>
    )
}

export default Asked
